import React from 'react';
import UserInfo from './leftside/userInfo'
import ShowTweets from '/rightside/showTweets'

function TwoBoxes(props) {
    return (
        <div className="TwoBoxes">
            <div className="LeftBox">
                {props.left}
            </div>
            <div className="rightBox">
                {props.right}
            </div>
        </div>
    );
}

export default Box;
